INSERT INTO `pois` VALUES (4,'PO-nM25GfBJZ3485','453drr435dsdfds',1,2070.505,1363.32,'0865282663','2023-05-11 06:29:43',5,8,'{\"en\": \"Hermes\", \"vi\": \"Hermes VN\"}','{\"en\": \"In an explosion of joy, pigments reveal the colorful take on the season’s collections loud and clear.\", \"vi\": \"In an explosion of joy, pigments reveal the colorful take on the season’s collections loud and clear.\"}'),(5,'PO-NUHV2XAsY5051','453drr43MFKWE',1,2099.91,1256.3850000000002,'23230934','2023-05-15 07:05:39',5,6,'{\"en\": \"Jo malone\", \"vi\": \"Jo malone\"}','{\"en\": \"With a focus on the core value of product quality, as well as service development, combining the customer experience at the point of sale to provide customers with confidence, formality and excitement in their shopping experience. For shopping, Giovanni Group has developed a wide range of products, from shirts and polos to elegant suits, or delicate leather accessories.\", \"vi\": \"Với việc tập trung vào giá trị cốt lõi về chất lượng sản phẩm, cũng như phát triển dịch vụ, kết hợp trải nghiệm khách hàng tại điểm bán lẻ nhằm cung cấp cho khách hàng sự tự tin, tính trang trọng và sự hứng khởi trong việc mua sắm, Giovanni Group đã phát triển đa dạng các dòng hàng, từ áo sơ mi, polo cho tới các bộ quần áo vest lịch lãm, hay các phụ kiện đồ da tinh tế.\"}'),(6,'PO-X1Mu3q_5F2437','dsdd453drr43M924we',1,2070.5,1471.445,'2323093432','2023-05-15 07:05:39',5,7,'{\"en\": \"DS squared2\", \"vi\": \"DS squared2\"}','{\"en\": \"And so, in 1992, the world was introduced to DSquared, the premium denim label who’s well-cut, heavily distressed and reassuringly expensive jeans would take over the 90’s fashion. With the brand motto of ‘Born in Canada, Living in London and Made in Italy’, you know exactly where DSquared comes from, and where it’s at now\", \"vi\": \"vào năm 1992, thế giới đã được giới thiệu với DSquared, nhãn hiệu denim cao cấp với những chiếc quần jean đắt tiền được cắt may khéo léo, dày dặn và chắc chắn sẽ chiếm lĩnh thời trang của thập niên 90. Với phương châm thương hiệu \'Sinh ra ở Canada, Sống ở Luân Đôn và Sản xuất tại Ý\', bạn biết chính xác DSquared đến từ đâu và hiện tại nó ở đâu\"}'),(7,'PO-qKFWxM3ej0755','4532ndjhrFKWE',1,1897.9168179646442,1467.411531294792,'','2023-05-15 07:07:01',5,7,'{\"en\": \"Karl Lagerfeld\", \"vi\": \"Karl Lagerfeld \"}','{\"en\": \"Karl Lagerfeld is a famous French fashion brand. Currently, this fashion company has more than 100 stores worldwide, offering high-end fashion products and accessories\", \"vi\": \"Karl Lagerfeld là thương hiệu thời trang nổi tiếng của Pháp. Hiện hãng thời trang này có hơn 100 cửa hàng trên toàn thế giới, các sản phẩm thời trang, phụ kiện cao cấp\"}'),(8,'PO-9wdm-1rWB9576','453drr43wwwMFKWE',1,1802.205,1467.411531294792,'23230932324','2023-05-15 07:07:01',5,7,'{\"en\": \"Longines\", \"vi\": \"Longines\"}','{\"en\": \"The brand was founded in 1832 in Switzerland (Switzerland) by Mr. Auguste Agassiz and is currently managed by The Swatch Group. Although there are now many people interested in the origin of products it is born from different countries but it seems to be no substitute for the Swiss watch brand.\", \"vi\": \"Thương hiệu được thành lập từ năm 1832 ở Switzerland (Thụy Sỹ) bởi ông Auguste Agassiz và hiện nay nó được quản lý bởi The Swatch Group. Mặc dù hiện nay có rất nhiều người quan tâm đến nguồn gốc của các sản phẩm nó được khởi sinh từ các quốc gia khác nhau nhưng dường như không thể thay thế cho thương hiệu đồng hồ Thụy Sĩ\"}'),(9,'PO-inRZXdAU58352','453drr43wwwMFKE',1,1802.205,1520.245,'024333666','2023-05-15 07:07:01',5,7,'{\"en\": \"Diesel\", \"vi\": \"Diesel\"}','{\"en\": \"The Diesel brand was founded by Renzo Rosso and Adriano Goldschmied after absorbing the American marketing process, Italian creative skills and German corporate organization. In 1979, Diesel launched its first men\'s collection. In 1990, the company opened the world\'s largest chain of stores with the first location in New York City. Since then, Diesel has 6,000 employees worldwide with 400 stores and 10,000 retail locations. In 2008, Diesel partnered with Adidas to launch a special denim line, partnered with L\'Oreal to launch the Fuel for Life perfume, partnered with Fossil to produce jewelry and watches, especially, the brand together with the car company Fiat to create a limited number of Fiat 500 Diesle cars\", \"vi\": \"Thương hiệu Diesel được Renzo Rosso và Adriano Goldschmied thành lập sau khi tiếp thu được quy trình marketing của Mỹ, kỹ năng sáng tạo của Ý và tổ chức bộ máy công ty của Đức. Năm 1979, Diesel ra mắt bộ sưu tập dành cho nam giới đầu tiên. Năm 1990, hãng mở chuỗi cửa hàng lớn nhất thế giới với địa điểm đầu tiên tại thành phố New York. Kể từ đó cho đến nay, Diesel có 6,000 nhân viên trên toàn thế giới với 400 cửa hàng và 10,000 điểm bán lẻ. Năm 2008, Diesel hợp tác với Adidas cho ra dòng sản phẩm denim đặc biệt, hợp tác với L\'Oreal cho ra mắt nước hoa Fuel for Life, hợp tác với Fossil để sản xuất trang sức và đồng hồ, đặc biệt, thương hiệu cùng với hãng xe hơi Fiat tạo ra dòng xe Fiat 500 Diesle số lượng giới hạn\"}'),(10,'PO-13WmX7gXy6245','55juuhuuh77676767',1,2073.264026,1093.868332,'0243555666','2023-05-15 07:07:01',5,9,'{\"en\": \"Chanel\", \"vi\": \"Chanel\"}','{\"en\": \"Chanel was founded by Coco Chanel in 1909 in Paris. The brand is famous for its powerful innovative designs that liberated women from the cumbersome and constrained outfits at that time. Coco Chanel created fashion classics such as the Little Black Dress (LDB), the Little Black Jacket and the Little Black Jacket.\", \"vi\": \"Chanel được sáng lập bởi Coco Chanel năm 1909 tại Paris. Thương hiệu nổi tiếng với những thiết kế cách tân mạnh mẽ giải phóng phụ nữ khỏi những trang phục rườm rà bó buộc lúc bấy giờ. Coco Chanel đã sáng tạo ra những trang phục trở thành kinh điển với thời trang như đầm Little Black Dress (LDB), áo khoác bằng vải tweed Little Black Jacket\"}'),(11,'PO-JWthzOxa-7463','453drr435dsdfd',1,1915.260013,1107.320004,'0243456789','2023-05-15 07:07:01',5,9,'{\"en\": \"Sisley\", \"vi\": \"Sisley\"}','{\"en\": \"In 1972 perfumer Jean-François Laporte and Roland de Saint-Vincent, created a perfume company.Hubert d\'Ornano acquired this company in 1976, re-naming it Sisley in reference to the Impressionist painter.\", \"vi\": \"Năm 1972, chuyên gia nước hoa Jean-François Laporte và Roland de Saint-Vincent thành lập công ty nước hoa. Hubert d\'Ornano mua lại công ty này vào năm 1976, đổi tên thành Sisley theo tên của họa sĩ trường phái Ấn tượng.\"}'),(12,'PO-PSkOxBdRx1253','453drr435dsdfda',1,1436.205291,1188.03004,'0243123456','2023-05-15 07:07:01',5,7,'{\"en\": \"Lacoste\", \"vi\": \"Lascoste\"}','{\"en\": \"Lacoste is a famous brand founded in 1933 in France\", \"vi\": \"Lacoste là một thương hiệu nổi tiếng được thành lập vào năm 1933 tại nước Pháp\"}'),(13,'PO-0y2EmY6B-0696','453drr435dsdfdas',1,1715.233655,1139.267727,'0243456678','2023-05-15 07:07:01',5,9,'{\"en\": \"Whoo\", \"vi\": \"Whoo\"}','{\"en\": \"WHOO or another name is The history of Whoo is one of the most high-end cosmetic brands in Korea under LG Household Care Group - Korea. The name recalls the dignified and noble beauty of the queens in the ancient court, as well as the elegance and elegance of Asian women. The product uses a beauty formula that is said to be a secret of the imperial court and Gongjindan - a recipe used exclusively for Emperors and Empresses in the feudal period. These products contain wild ginseng and snow lotus to create an elegant and naturally glowing skin\", \"vi\": \"WHOO hay với tên gọi khác là The history of Whoo là một trong những thương hiệu mỹ phẩm cao cấp nhất tại Hàn Quốc thuộc tập đoàn LG Household Care - Hàn Quốc. Tên gọi gợi nhớ nét đẹp đoan trang, cao quý của những vị hoàng hậu trong cung đình xưa, cũng như sự thanh lịch, tao nhã của phụ nữ Châu Á. Sản phẩm sử dụng công thức làm đẹp được cho là bí mật của triều đình và Gongjindan - một công thức sử dụng riêng cho Hoàng Đế và Hoàng Hậu vào giai đoạn phong kiến. Các sản phẩm này có chứa nhân sâm hoang dã và hoa sen tuyết để tạo ra một làn da thanh lịch và tươi sáng tự nhiên\"}'),(14,'PO-LANIzOlQ32169','453drr435dsdfd1',1,1575.719473,1179.622744,'0243987123','2023-05-15 07:07:01',5,7,'{\"en\": \"Fred Perry\", \"vi\": \"Fred Perry\"}','{\"en\": \"Famous street style brand Fred Perry from the UK with a strong, modern but equally elegant style. The history of the brand began with the father Frederick John Perry, he was born in 1909. The glory of Tennis came to Perry in 1929. Fred Perry won a total of 8 Grand Slam tournaments with 3 consecutive victories at Wimbledon since 1934 to 1936 and held the number one position in the world for 4 consecutive years\", \"vi\": \"Thương hiệu street style nổi tiếng Fred Perry từ nước Anh với phong cách khỏe khoắn, hiện đại nhưng không kém phần lịch lãm. Lịch sử thương hiệu bắt đầu với cha đẻ Frederick John Perry, ông sinh ra vào năm 1909. Vầng hào quang của Tennis đến với Perry vào năm 1929. Fred Perry dành tổng cộng 8 giải Grand Slam với 3 chiến thắng liên tiếp tại Wimbledon từ 1934 đến 1936 và giữ vị trí số một thế giới trong vòng 4 năm liên tục\"}'),(15,'PO-pBraBtmpT3216','453drr435dsdfd2',1,1466.461379,1349.45011,'0243567789','2023-05-15 07:07:01',5,5,'{\"en\": \"Pandora\", \"vi\": \"Pandora\"}','{\"en\": \"Let the world listen to your story and express your personality with beautiful jewelry designs from the Pandora brand.\", \"vi\": \"Hãy để thế giới lắng nghe câu chuyện của bạn và thể hiện cá tính riêng cùng những thiết kế trang sức tuyệt mỹ từ thương hiệu Pandora.\"}'),(16,'PO-Y6XTn8_q49026','453drr435dsdfd3',1,1662.630166,1131.157102,'02432134567','2023-05-15 07:07:01',7,7,'{\"en\": \"Crown Space\", \"vi\": \"Crown Space\"}','{\"en\": \"Crown UK Vietnam has now become a leading supplier of high-end children\'s footwear and fashion products with brands Royale Baby, Crown Uk, Tanaka and Poney Kiz, Crown Kids, HKHS Shirley nationwide. with many showrooms stretching from Hanoi - Hai Phong - Ho Chi Minh City\", \"vi\": \"Công ty Crown UK Việt Nam hiện đã trở thành nhà cung cấp hàng đầu các sản phẩm giày dép, thời trang trẻ em cao cấp với các nhãn hiệu Royale Baby, Crown Uk, Tanaka và Poney Kiz, Crown Kids, HKHS Shirley trên toàn quốc với nhiều showroom trải dài từ Hà Nội – Hải Phòng – TP. Hồ Chí Minh.\"}'),(17,'PO-JDe3omlfh9210','453drr435dsdfd4',1,2077.541793,1222.424898,'0234567890','2023-05-15 07:07:01',7,7,'{\"en\": \"W Cath Kidston\", \"vi\": \"Cath Kidston\"}','{\"en\": \"Cath Kidston Limited is an international British home furniture retailer with headquarters in London, focusing on vintage themed and handicraft items that embody the quintessential lifestyle of people. Older brother.\", \"vi\": \"Cath Kidston Limited là một công ty bán lẻ đồ nội thất gia đình quốc tế của Anh có trụ sở chính tại London, tập trung vào các mặt hàng thủ công mỹ nghệ và theo chủ đề cổ điển thể hiện phong cách sống tinh hoa của người Anh.\"}'),(18,'PO-jgBF0h39d0819','453drr435dsdfd5',1,1753.867277,1120.291888,'0243567789','2023-05-15 07:07:01',7,7,'{\"en\": \"Rookie\", \"vi\": \"Rookie\"}','{\"en\": \"Rookie Sportswear Vn was established in 2017, is a Vietnamese men\'s sportswear brand for Gymer, Trainer,... designed and manufactured by the Founder who is a genuine Gymer.\", \"vi\": \"Rookie Sportswear Vn được thành lập năm 2017, là thương hiệu thời trang thể thao nam Việt Nam dành cho Gymer, Trainer…..do Founder là 1 Gymer chính hiệu thiết kế và sản xuất.\"}'),(19,'PO-fUES_A_Gn5130','453drr435dsdfd6',1,2590.207469,1068.138861,'024323431132','2023-05-15 07:07:01',7,12,'{\"en\": \"Sa Maison\", \"vi\": \"Sa Maison\"}','{\"en\": \"Sa Maison specializes in providing products such as furniture, tableware, kitchen tools, decorations, household appliances.\", \"vi\": \"Sa Maison chuyên cung cấp các sản phẩm như đồ nội thất, dụng cụ bàn ăn, dụng cụ phòng bếp, đồ trang trí, đồ gia dụng\"}'),(20,'PO-pX9LWJr1C8178','453drr435dsdfd7',1,2842.195682,1461.459602,'0243564345','2023-05-15 07:07:01',7,12,'{\"en\": \"Tefal\", \"vi\": \"Tefal\"}','{\"en\": \"Tefal S.A.S. is a French manufacturer of cookware and small appliances, owned by Groupe SEB since 1968. The company is known for creating a portfolio of non-stick cookware and offering frying equipment. with low requirements for fat or oil\", \"vi\": \"Tefal S.A.S. là nhà sản xuất dụng cụ nấu nướng và thiết bị nhỏ của Pháp, thuộc sở hữu của Groupe SEB từ năm 1968. Công ty này được biết đến với việc tạo ra danh mục dụng cụ nấu nướng chống dính và cung cấp thiết bị chiên rán với yêu cầu thấp về chất béo hoặc dầu\"}'),(21,'PO-zUgbhipAL0346','453drr435dsdfd8',1,2985.568286,1496.228287,'0243987456','2023-05-15 07:07:01',7,12,'{\"en\": \"LUG.vn\", \"vi\": \"LUG.vn\"}','{\"en\": \"LUG will be a companion to help Vietnamese people pack all their luggage both on and off the road, bringing full personal items to bring back all the memorable memories, both materially and spiritually.\", \"vi\": \"LUG sẽ là người bạn đồng hành giúp người Việt gói trọn mọi hành lý cả đi lẫn về, mang theo đầy đủ vật dụng cá nhân để mang về đầy đủ những kỉ niệm đáng nhớ, cả vật chất lẫn tinh thần.\"}'),(22,'PO-KznSdInzR3306','453drr435dsdfd9',1,2703.167702,1813.492531,'0243234345','2023-05-15 07:07:01',7,5,'{\"en\": \"Giovanni\", \"vi\": \"Giovanni\"}','{\"en\": \"With a focus on the core value of product quality, as well as service development, combining the customer experience at the point of sale to provide customers with confidence, formality and excitement in their shopping experience. For shopping, Giovanni Group has developed a wide range of products, from shirts and polos to elegant suits, or delicate leather accessories.\", \"vi\": \"Với việc tập trung vào giá trị cốt lõi về chất lượng sản phẩm, cũng như phát triển dịch vụ, kết hợp trải nghiệm khách hàng tại điểm bán lẻ nhằm cung cấp cho khách hàng sự tự tin, tính trang trọng và sự hứng khởi trong việc mua sắm, Giovanni Group đã phát triển đa dạng các dòng hàng, từ áo sơ mi, polo cho tới các bộ quần áo vest lịch lãm, hay các phụ kiện đồ da tinh tế.\"}'),(23,'PO-1skam_Qx-8066','453drr435dsdf1',1,3539.507894,1437.556132,'0243213321','2023-05-15 07:07:01',7,12,'{\"en\": \"Lock&Lock\", \"vi\": \"Lock&Lock\"}','{\"en\": \"Lock & Lock is a home products company based in Seoul, South Korea. Since its founding in 1978, Lock & Lock has exported its products to 119 countries worldwide. The company has a wide range of products for food containers, cookware, cups and pitchers.\", \"vi\": \"Lock & Lock là một công ty sản phẩm gia dụng có trụ sở tại Seoul, Hàn Quốc. Kể từ khi thành lập vào năm 1978, Lock & Lock đã xuất khẩu sản phẩm tới 119 quốc gia trên toàn thế giới. Công ty có một loạt các loại sản phẩm cho hộp đựng thực phẩm, dụng cụ nấu ăn, cốc và bình đựng nước.\"}'),(24,'PO-2BojqWYxs5866','453drr435dsdf2',1,1412.814264,1235.463154,'0243453367','2023-05-15 07:07:01',7,10,'{\"en\": \"Yu Tang\", \"vi\": \"Yu Tang\"}','{\"en\": \"Yu Tang is the first place to create and also the only brand owning the artisan pearl recipe in Vietnam. Not only bringing traditional milk tea cups, Yu Tang also serves typical dishes of Taiwanese cuisine.\", \"vi\": \"Yu Tang là nơi đầu tiên sáng tạo và cũng là thương hiệu duy nhất sở hữu công thức trân châu nghệ nhân tại Việt Nam. Không chỉ mang lại những ly trà sữa truyền thống, Yu Tang còn phục vụ cả những món ăn đặc trưng của ẩm thực Đài Loan.\"}'),(25,'PO-kVTPDhMxP7178','453drr435dsdf3',1,2071.024856,1778.723846,'0243678896','2023-05-15 07:07:01',7,26,'{\"en\": \"wSom Thai\", \"vi\": \"Som Thai\"}','{\"en\": \"Som Thai brings true Thai taste to Vietnam with a team of experienced Thai chefs\", \"vi\": \"Som Thai mang đúng chuẩn vị Thái đến Việt Nam với đội ngũ đầu bếp Thái nhiều kinh nghiệm\"}'),(26,'PO-P_iteNWH85650','453drr435dsdf4',1,1790.4731962668639,1459.5261495102568,'0243678897','2023-05-15 07:07:01',7,29,'{\"en\": \"Ush